import React from 'react';
import PropTypes from 'prop-types';

export const Checkout = ({itemCount}) => (
      <div className="container mr-2">

        <div className="row  justify-content-end">
          {itemCount > 0?
            <span className="text-sm-end justify-content-center">Item Count: {itemCount}</span>
            :
            <span/> 
          }
          <button type="button" className="btn btn-primary ml-2" >Checkout</button>   
        </div>
      </div>
);

Checkout.propTypes = {
  itemCount: PropTypes.string.isRequired
}
